import React from "react";
function ButtonUse() {
  return (
    <div>
      <form name="search" action="../../../backend/app.py" method="get">
        <input
          placeholder="https://linkedin.com"
          type="url"
          name="linkedinUrl"
          className="inputs"
        ></input>
        <input type="submit" value="Go"></input>
      </form>
    </div>
  );
}

export default ButtonUse;
